import React, { Component } from 'react'
import styles from '../../style/Admin.module.less'

import { Menu, Dropdown, Icon, message, Button } from 'antd';


function handleMenuClick(e) {
	message.info('Click on menu item.');
	console.log('click', e);
}

const menu = (
	<Menu onClick={handleMenuClick}>
		<Menu.Item key="1">
			<Icon type="user" />
			个人信息
	  </Menu.Item>
		<Menu.Item key="2">
			<Icon type="user" />
			个人设置
	  </Menu.Item>
		<Menu.Item key="3">
			<Icon type="user" />
			退出登录
	  </Menu.Item>
	</Menu>
)


class HeaderNav extends Component {
	// constructor(){
	// super()
	// this.setState
	// }
	render() {
		return (
			<div className={styles.headerNav}>
				<Dropdown overlay={menu}>
					<Button>
						root <Icon type="down" />
					</Button>
				</Dropdown>
			</div>
		)
	}
}

export default HeaderNav
